import Header from './components/Header'
import Nav from './components/Nav'
import logo from './logo.svg';
import './App.css';

class Note extends Component {
  render() {
    return(
      <div className="Note">
        s
      </div>
    )
  }
}

class Main extends Component {
  render() {
    return(
      <div className="Main">
         <Note/>
         <Note/>
      </div>
    )
  }
}




class App extends Component {
  render() {
    return(
      <div className="App">
        <Header></Header>
        <Nav></Nav>
        <Main></Main>
      </div>
    )

  }
}

export default App;
